use evmole::{function_arguments, function_selectors};

use crate::evm::contract_utils::ABIConfig;

pub fn fetch_abi_evmole(bytecode: &[u8]) -> Vec<ABIConfig> {
    let selectors = function_selectors(bytecode, 0);
    selectors
        .into_iter()
        .map(|sig| ABIConfig {
            abi: format!("({})", function_arguments(bytecode, &sig, 0)),
            function: sig,
            function_name: hex::encode(sig),
            is_static: false,
            is_payable: true,
            is_constructor: false,
            should_add_corpus: true,
        })
        .collect()
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_evmole() {
        let code = hex::decode(r#""#,
        ).unwrap();

        println!("{:?}", fetch_abi_evmole(&code));
    }
}
